What does it mean when a binary encrypted row is dumped? From the SQLite documentation : : Use the ".dump" command to convert the entire contents of a database into a single UTF-8 text file. We cannot turn an encrypted row into UTF-8 text without the key, and we cannot control who uses the dump command. For example a dump session might look like: $ lumosql rbac-example-db.lumo
@lumosql> .dump :
INSERT INTO "my_table" VALUES(X'AB12340CDE.... 12234DEF'); Related to the above, but to be very clear, an encrypted row is not another datatype, and the BLOB affinity cannot help here.
